 apOut[3] = -lTmp;

 lTmp = ( int )FRAC_RND(
                MUL64( -apIn[ 0 ], C5  ) + lIn1_9 +
                MUL64(  apIn[ 2 ], C1  ) + 
                MUL64(  apIn[ 3 ], C11 ) - lIn4_3 -
                MUL64(  apIn[ 5 ], C7  )
               );
