 lTmp = ( int )FRAC_RND(
                -MUL64( apIn[ 0 ], C1  ) - lIn1_3 -
                 MUL64( apIn[ 2 ], C5  ) -
                 MUL64( apIn[ 3 ], C7  ) - lIn4_9 -
                 MUL64( apIn[ 5 ], C11 )
               );
